            description:
              - text: "|| Digitaler Motor V8 Erzeugt mehr Saugkraft als der Dyson Digitaler
                  Motor V6.|| 2 Tier Radial Cyclone Technologie Zwei
                  Zyklonreihen arbeiten gleichzeitig, um den Luftstrom zu
                  erhöhen und mehr mikroskopisch kleine Staubpartikel aufnehmen
                  zu können.|| Nickel-Cobalt-Aluminium Akku Gleichmäßiger
                  Verbrauch der Akkuleistung. Bis zu 40 Minuten Laufzeit.|| Vom
                  Boden bis zur Decke – und für alles dazwischen Abnehmbares
                  Rohr zur flexiblen Reinigung von schwer erreichbaren
                  Stellen.|| Verbesserte hygienischere Behälterentleerung Durch
                  die verbesserte Behälterentleerung mit nur einem Handgriff,
                  entsteht beim Entleeren kein Kontakt mit dem Staub. ||
                  Elektrobürste mit Direktantrieb Angetrieben von einem
                  leistungsstarken Motor im Inneren der Bürstwalze. Feste
                  Nylonborsten entfernen tiefsitzenden Schmutz und Tierhaare von
                  Teppichböden. Weiche Carbonfasern nehmen feinen Staub von
                  Hartböden auf. Nachmotorfilter Filter für eine reinere
                  Ausblasluft als die Raumluft, die Sie atmen. Ideal für
                  Allergiker. Zwei Saugstufen Standardmodus für leichten Schmutz
                  und Maximalmodus für starken Schmutz. Mini-Elektrobürste Zum
                  Entfernen von tiefsitzendem Schmutz und Tierhaaren von
                  Polstern. Flexi-Fugendüse Ausziehbar und biegsam zur Reinigung
                  von Ecken. Wandhalterung mit Ladestation Zur Aufbewahrung und
                  zum Laden des Gerätes. 2-teiliges Zubehör Kombidüse und
                  Fugendüse für die Reinigung von schwer erreichbaren Stellen.
                  Motorleistung: 425 W. Akkuleistung: 21,6 V. Saugkraft bis zu
                  (Norm.- / Max.-Modus): 28 / 115 AW. Betriebsdauer bis zu
                  (Norm.- / Max.-Modus): 40 / 7 Min. Ladezeit: 5 Stunden.
                  Behälterkapazität: 0,54 Liter. Nachmotorfilter. Zwei
                  Saugstufen. Elektrobürste mit Direktantrieb,
                  Mini-Elektrobürste, Flexi-Fugendüse, Wandhalterung mit
                  Ladestation, 2-teiliges Zubehör: Kombidüse und Fugendüse."
